import React from 'react';

const about = (
    <div>
        <p>Hi, I'm Ross!</p>
        <p>I work for a company called <a href="https://www.togetherwork.com/" >Togetherwork</a> as a 
        Software Engineer. My time there is spent working on the Togetherpay team - maintaining our 
        payment platform API, adding new features to our front end reporting application, and 
        providing support to our team of Business Analysts.</p>
        <p>Outside of work, I enjoy spending time with my family and our dogs, Walter and Trista. Some 
            of my other hobbies include: riding motorcycles, music and movies, making coffee for 
            my team at work, and enjoying a nice beer - I like stouts and IPAs.
        </p>
    </div>
    );

export default about;
